%Vibration Robot Full Simulation
%Ian Stewart
clear
clc
close all
%% Main
global mode SLIPRDIR SLIPLDIR timestep %#ok<*GVMIS>
pos = 0;
rpm1 = [4215.95 4908.81 5255.24 5601.67 6294.53 6987.39 7680.25 8373.11 9065.97 9758.83];
rpm2 = [100 1000 1800 2645];
TSTEP = [100 1000 10000 100000];
SLIP = zeros(1,length(rpm1));
TIME = zeros(1,length(rpm1));
VELOCITY = zeros(1,length(rpm1));
for j = 1:length(rpm1)
    mode = 1 %#ok<NOPTS> %Start in stick mode
    RPM =rpm1(j) %#ok<NOPTS> %Set rpm for the motor
    timestep = 10000;
    dB = 0; %Initial position of Left bristle [m]
    dD = 0; %Initial position of Right bristle [m]
    IC = [0 0]; %Initial conditions [rad,rad/s]
    t0 = 0; %Initial time [s]
    FullSim = []; %Initialize simulation data in order: 1) time, 2) Theta, 3) DTheta, 4) X, 5) DX, 6) Y, 7) DY, 8) lambda1, 9) lambda2, 10) coulomb1, 11) lambda3, 12) lambda4, 13) coulomb2, 14) dB, 15) ddB, 16) dD, 17) ddD
    %Loop through simulation modes
    for i = 1:15
        previousMode = mode;
        switch mode
            case 0 %The bristles did something unpredicted
                edgecase = 1  %#ok<NOPTS>
                break
            case 1 %Both bristle tips are fixed on the tube walls
                [timeData,thetaData,xData,yData,lambdaData,bristleTipData,stickCondition,bristleAngle] = stick(dB,dD,IC,RPM,t0);
            case 2 %The right side bristle slips but does not lose contact
                [timeData,thetaData,xData,yData,lambdaData,bristleTipData,stickCondition,bristleAngle] = slipRight(dB,IC,RPM,t0);
            case 3 %The left side bristle slips but does not lose contact
                [timeData,thetaData,xData,yData,lambdaData,bristleTipData,stickCondition,bristleAngle] = slipLeft(dD,IC,RPM,t0);
            case 4 %Both bristles slips are in the slip mode simultaneously
                [timeData,thetaData,xData,yData,lambdaData,bristleTipData,stickCondition,bristleAngle] = slipBoth(IC,RPM,t0);
        end
        mode; %#ok<NOPTS> 
        %Set new starting time and position
        t0 = timeData(end);
        dB = bristleTipData(1,end);
        dD = bristleTipData(3,end);
        SLIPLDIR = -sign(lambdaData(2,end));
        SLIPRDIR = -sign(lambdaData(5,end));
        %Set new initial conditions
        [A,a,b,c,g,I,K,k_cs,L,M,mp,R_r,T,w,alpha_0,mu_k_big,mu_k_small,mu_s_big,mu_s_small,varphi] = parameters(RPM);
        if mode == 1
            IC = thetaData(:,end)'; %[rad,rad/s]
        elseif mode == 2
            Theta = thetaData(1,end); DTheta = thetaData(2,end);
            X = 0.5*dD + 0.5*R_r*sin(Theta) - 0.5*c*(cos(Theta) - 1) - 0.5*L*cos(alpha_0)*((R_r*sin(Theta) - dB + c*(cos(Theta) - 1))/(L*cos(alpha_0)) - (2*R_r*(cos(Theta) - 1))/(L*sin(alpha_0)));
            DX = 0.5*DTheta*R_r*cos(Theta) - 0.5*L*cos(alpha_0)*((DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta))/(L*cos(alpha_0)) + (2*DTheta*R_r*sin(Theta))/(L*sin(alpha_0))) + 0.5*DTheta*c*sin(Theta);
            IC = [Theta DTheta X DX]; %[rad,rad/s,m,m/s]
        elseif mode == 3
            Theta = thetaData(1,end); DTheta = thetaData(2,end);
            X = 0.5*dB - 0.5*R_r*sin(Theta) - 0.5*c*(cos(Theta) - 1) + 0.5*L*cos(alpha_0)*((dD + R_r*sin(Theta) - c*(cos(Theta) - 1))/(L*cos(alpha_0)) + (2*R_r*(cos(Theta) - 1))/(L*sin(alpha_0)));
            DX = 0.5*L*cos(alpha_0)*((DTheta*R_r*cos(Theta) + DTheta*c*sin(Theta))/(L*cos(alpha_0)) - (2*DTheta*R_r*sin(Theta))/(L*sin(alpha_0))) - 0.5*DTheta*R_r*cos(Theta) + 0.5*DTheta*c*sin(Theta);
            IC = [Theta DTheta X DX]; %[rad,rad/s,m,m/s]
        elseif mode == 4
            Theta = thetaData(1,end); DTheta = thetaData(2,end);
            X = (0.5*cos(alpha_0)*((sin(alpha_0)*(dD + R_r*sin(Theta) - c*(cos(Theta) - 1) + (cos(alpha_0)*(c*sin(Theta) + R_r*(cos(Theta) - 1)))/sin(alpha_0)))/cos(alpha_0) - (sin(alpha_0)*(R_r*sin(Theta) - dB + c*(cos(Theta) - 1) + (cos(alpha_0)*(c*sin(Theta) - R_r*(cos(Theta) - 1)))/sin(alpha_0)))/cos(alpha_0)))/sin(alpha_0);
            Y = (sin(alpha_0)*(R_r*sin(Theta) - dB + c*(cos(Theta) - 1) + (cos(alpha_0)*(c*sin(Theta) - R_r*(cos(Theta) - 1)))/sin(alpha_0) + (0.5*cos(alpha_0)*((sin(alpha_0)*(dD + R_r*sin(Theta) - c*(cos(Theta) - 1) + (cos(alpha_0)*(c*sin(Theta) + R_r*(cos(Theta) - 1)))/sin(alpha_0)))/cos(alpha_0) - (sin(alpha_0)*(R_r*sin(Theta) - dB + c*(cos(Theta) - 1) + (cos(alpha_0)*(c*sin(Theta) - R_r*(cos(Theta) - 1)))/sin(alpha_0)))/cos(alpha_0)))/sin(alpha_0)))/cos(alpha_0);
            if previousMode == 1
                DX = -(DTheta*R_r*cos(alpha_0)*sin(Theta) - DTheta*c*sin(Theta)*sin(alpha_0))/sin(alpha_0);
                DY = -(sin(alpha_0)*((DTheta*R_r*cos(alpha_0)*sin(Theta) - DTheta*c*sin(Theta)*sin(alpha_0))/sin(alpha_0) - (cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) - DTheta*R_r*cos(Theta) + DTheta*c*sin(Theta)))/cos(alpha_0);
            elseif previousMode == 2
                ddd = bristleTipData(4,end);
                DX = -(0.5*cos(alpha_0)*((sin(alpha_0)*((cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta)))/cos(alpha_0) - (sin(alpha_0)*(ddd - (cos(alpha_0)*(DTheta*R_r*sin(Theta) - DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*R_r*cos(Theta) + DTheta*c*sin(Theta)))/cos(alpha_0)))/sin(alpha_0);
                DY = (sin(alpha_0)*((cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta) - (0.5*cos(alpha_0)*((sin(alpha_0)*((cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta)))/cos(alpha_0) - (sin(alpha_0)*(ddd - (cos(alpha_0)*(DTheta*R_r*sin(Theta) - DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*R_r*cos(Theta) + DTheta*c*sin(Theta)))/cos(alpha_0)))/sin(alpha_0)))/cos(alpha_0);
            elseif previousMode == 3
                ddb = bristleTipData(2,end);
                DX = (0.5*cos(alpha_0)*((sin(alpha_0)*(DTheta*R_r*cos(Theta) - (cos(alpha_0)*(DTheta*R_r*sin(Theta) - DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*c*sin(Theta)))/cos(alpha_0) + (sin(alpha_0)*(ddb - (cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) - DTheta*R_r*cos(Theta) + DTheta*c*sin(Theta)))/cos(alpha_0)))/sin(alpha_0);
                DY = (sin(alpha_0)*((cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) - ddb + DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta) + (0.5*cos(alpha_0)*((sin(alpha_0)*(DTheta*R_r*cos(Theta) - (cos(alpha_0)*(DTheta*R_r*sin(Theta) - DTheta*c*cos(Theta)))/sin(alpha_0) + DTheta*c*sin(Theta)))/cos(alpha_0) + (sin(alpha_0)*(ddb - (cos(alpha_0)*(DTheta*R_r*sin(Theta) + DTheta*c*cos(Theta)))/sin(alpha_0) - DTheta*R_r*cos(Theta) + DTheta*c*sin(Theta)))/cos(alpha_0)))/sin(alpha_0)))/cos(alpha_0);
            else
                X = xData(1,end);
                Y = yData(1,end);
                DX = xData(2,end);
                DY = yData(2,end);
            end
            IC = [Theta DTheta X DX Y DY]; %[rad,rad/s,m,m/s,m,m/s]
        end
        %Compile theta, x, y, and lambda data
        SimData = zeros(25,length(timeData)); %#ok<PREALL>
        SimData = [timeData;thetaData;xData;yData;lambdaData;bristleTipData;stickCondition;bristleAngle]; %[s,rad,rad/s,m,m/s,m,m/s,N,N,N,N,N,N,m,m/s,m,m/s]
        FullSim = [FullSim SimData]; %#ok<AGROW>
    end
    pos = pos + 1;
    midPoint = floor(0.75*size(FullSim,2));
    SLIP(1,pos) = FullSim(4,end)-FullSim(4,midPoint);
    TIME(1,pos) = FullSim(1,end)-FullSim(1,midPoint);
    VELOCITY(1,pos) = -SLIP(1,pos)/TIME(1,pos);
    
%     figure(1)
%     subplot(4,1,j)
%     plot(FullSim(1,:),FullSim(17,:))
%     title('T/100','FontSize',12,'interpreter','latex')
%     ylabel('Velocity [m/s]','FontSize',12,'interpreter','latex')
%     figure(1)
%     subplot(4,1,j)
%     plot(FullSim(1,:),FullSim([12 13],:))
%     ylim([-1 1])
%     title('100 RPM','FontSize',12,'interpreter','latex')
%     ylabel('Force [N]','FontSize',12,'interpreter','latex')
    
end

