%% Stick Function
function [timeData,thetaData,xData,yData,lambdaData,bristleTipData,stickCondition,bristleAngle] = stick(dB,dD,IC,RPM,t0)
    %Parameters
    global mode timestep
    [A,a,b,c,g,I,K,k_cs,L,M,mp,R_r,T,w,alpha_0,mu_k,mu_s_big,mu_s_small,varphi] = parameters(RPM); %#ok<ASGLU> 
    %ODE time serise data
    tspan = t0:T/timestep:(3*T + t0);
    options = odeset('Events',@(t,Z) EventStick(t,Z,A,a,b,c,dB,dD,g,I,K,k_cs,L,M,mp,R_r,w,alpha_0,mu_s_big,mu_s_small,varphi));
    [time,output] = ode45(@(t,Z) odeStick(t,Z,A,a,b,c,dB,dD,g,I,K,k_cs,L,M,mp,R_r,w,alpha_0,varphi),tspan,IC,options);
    x = zeros(1,length(time));
    dx = zeros(1,length(time));
    y = zeros(1,length(time));
    dy = zeros(1,length(time));
    lambda1 = zeros(1,length(time));
    lambda2 = zeros(1,length(time));
    lambda3 = zeros(1,length(time));
    lambda4 = zeros(1,length(time));
    coulomb1 = zeros(1,length(time));
    coulomb2 = zeros(1,length(time));
    db = zeros(1,length(time));
    ddb = zeros(1,length(time));
    dd = zeros(1,length(time));
    ddd = zeros(1,length(time));
    staticCoulombL = zeros(1,length(time));
    staticCoulombR = zeros(1,length(time));
    labdaL = zeros(1,length(time));
    labdaR = zeros(1,length(time));
    dalpha = zeros(1,length(time));
    ddalpha = zeros(1,length(time));
    dbeta = zeros(1,length(time));
    ddbeta = zeros(1,length(time));
    for i = 1:length(time)
        Theta = output(i,1); DTheta = output(i,2);
        x(1,i) = dB/2 + dD/2 + (R_r*cos(alpha_0)/sin(alpha_0) - c)*(cos(output(i,1)) - 1);
        dx(1,i) = -(R_r*cos(alpha_0)/sin(alpha_0) - c)*sin(output(i,1)*output(i,2));
        y(1,i) = (R_r*sin(alpha_0)/cos(alpha_0) + c)*sin(output(i,1)) - (sin(alpha_0)*(dB - dD))/(2*cos(alpha_0));
