%% Slip Right Function
function [timeData,thetaData,xData,yData,lambdaData,bristleTipData,stickCondition,bristleAngle] = slipRight(dB,IC,RPM,t0)
    %Parameters
    global mode SLIPRDIR timestep
    [A,a,b,c,g,I,K,k_cs,L,M,mp,R_r,T,w,alpha_0,mu_k_big,mu_k_small,mu_s_big,mu_s_small,varphi] = parameters(RPM);
    slipRdir = SLIPRDIR;
    %ODE time serise data
    tspan = t0:T/timestep:(5*T + t0);
    options = odeset('Events',@(t,Z) EventSlipRight(t,Z,A,a,b,c,dB,g,I,K,k_cs,L,M,mp,R_r,w,alpha_0,mu_k_big,mu_k_small,mu_s_big,mu_s_small,varphi));
    [time,output] = ode45(@(t,Z) odeSlipR(t,Z,A,a,b,c,dB,g,I,K,k_cs,L,M,mp,mu_k_big,mu_k_small,R_r,w,alpha_0,varphi),tspan,IC,options);
    y = zeros(1,length(time));
    dy = zeros(1,length(time));
    lambda1 = zeros(1,length(time));
    lambda2 = zeros(1,length(time));
    lambda3 = zeros(1,length(time));
    lambda4 = zeros(1,length(time));
    coulomb1 = zeros(1,length(time));
    coulomb2 = zeros(1,length(time));
    db = zeros(1,length(time));
    ddb = zeros(1,length(time));
    dd = zeros(1,length(time));
    ddd = zeros(1,length(time));
    staticCoulombL = zeros(1,length(time));
    staticCoulombR = zeros(1,length(time));
    labdaL = zeros(1,length(time));
    labdaR = zeros(1,length(time));
    dalpha = zeros(1,length(time));
    ddalpha = zeros(1,length(time));
    dbeta = zeros(1,length(time));
    ddbeta = zeros(1,length(time));
    for i = 1:length(time)
        t = time(i,1); Theta = output(i,1); DTheta = output(i,2); X = output(i,3); DX = output(i,4);
        y(1,i) = R_r*((sin(output(i,1))*sin(alpha_0))/cos(alpha_0) - cos(output(i,1)) + 1) + c*(sin(output(i,1)) - sin(alpha_0)/cos(alpha_0) + (cos(output(i,1))*sin(alpha_0))/cos(alpha_0)) + (sin(alpha_0)*output(i,3))/cos(alpha_0) - (dB*sin(alpha_0))/cos(alpha_0);
        dy(1,i) = R_r*(sin(output(i,1))*output(i,2) + (cos(output(i,1))*sin(alpha_0)*output(i,2))/cos(alpha_0)) + c*(cos(output(i,1))*output(i,2) - (sin(output(i,1))*sin(alpha_0)*output(i,2))/cos(alpha_0)) + (sin(alpha_0)*output(i,4))/cos(alpha_0);
