        ddd(1,i) = output(i,4) - output(i,2)*R_r*cos(output(i,1)) + L*cos(alpha_0)*((output(i,4) + output(i,2)*R_r*cos(output(i,1)) - output(i,2)*c*sin(output(i,1)))/(L*cos(alpha_0)) + (2*output(i,2)*R_r*sin(output(i,1)))/(L*sin(alpha_0))) - output(i,2)*c*sin(output(i,1));
        if i > 1
            slipRdir = sign(ddd(1,i));
        end
        if slipRdir >= 0
            mu_k = mu_k_small;
        else
