%% ODE45 Slip Both
function DZDT = odeSlipBoth(t,Z,A,a,b,c,g,I,K,k_cs,L,M,mp,mu_k_big,mu_k_small,R_r,w,alpha_0,varphi)
    global SLIPRDIR SLIPLDIR
    Theta = Z(1); DTheta = Z(2); X = Z(3); DX = Z(4); Y = Z(5); DY = Z(6); %#ok<NASGU>
    if SLIPRDIR > 0
        slipRdir = SLIPRDIR;
        SLIPRDIR = 0;
    else
        ddd = DX + (cos(alpha_0)*(DY + DTheta*R_r*sin(Theta) - DTheta*c*cos(Theta)))/sin(alpha_0) - DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta);
        slipRdir = sign(ddd);
    end
    if SLIPLDIR > 0
        slipLdir = SLIPLDIR;
        SLIPLDIR = 0;
    else
        ddb = DX + DTheta*R_r*cos(Theta) - DTheta*c*sin(Theta) + (cos(alpha_0)*(DTheta*R_r*sin(Theta) - DY + DTheta*c*cos(Theta)))/sin(alpha_0);
        slipLdir = sign(ddb);
    end
    if slipLdir >= 0
        mu_k_L = mu_k_small;
    else
        mu_k_L = mu_k_big;
    end
    if slipRdir >= 0
        mu_k_R = mu_k_small;
    else
        mu_k_R = mu_k_big;
    end
    Lambda2 = -(slipLdir*abs(K*mu_k_L*(A + Theta + (Y - c*sin(Theta) + R_r*(cos(Theta) - 1))/(L*sin(alpha_0)))))/abs(L*sin(alpha_0) + L*mu_k_L*slipLdir*cos(alpha_0));
    Lambda4 = -(slipRdir*abs(K*mu_k_R*(A - Theta + (c*sin(Theta) - Y + R_r*(cos(Theta) - 1))/(L*sin(alpha_0)))))/abs(L*sin(alpha_0) + L*mu_k_R*slipRdir*cos(alpha_0));
    DZDT = zeros(6,1);
    %Theta dot
