%% Parameter Function
function [A,a,b,c,g,I,K,k_cs,L,M,mp,R_r,T,w,alpha_0,mu_k_big,mu_k_small,mu_s_big,mu_s_small,varphi] = parameters(RPM)
    %Measured parameters
    a = 1.85/1000; %Distance to center oentric mass [m]
    alpha_r = pi()/4; %Rest angle of cilia [rad]
    c = 2.883/1000; %CG to bristle base [m]
    b = (17.4 - c*1000)/1000; %CG to eccentric mass [m]
    g = 9.81; %Gravity [m/s^2]
    I = 9.4391*10^-7; %Moment of inertia of robot body [kg*m^2]
    K = 10*2*(0.0246); %Torsional spring const [Nm/rad]
    k_cs = 10*2*K;
    L = 7.06/1000; %Length of bristle [m]
    M = 11.218/1000; %Mass of the robot and eccentric mass [kg]
    mp = 0.942/1000; %Mass of the eccentric mass [kg]
    mu_k_big = 0.19; %Kinetic friction coefficient [-]
    mu_k_small = 0.04;
    mu_s_big = 0.39; %Static friction coefficient [-]
    mu_s_small = 0.06;
    R_r = (20.43/2)/1000; %Radius of robot body [m]
    R_t = (28.3/2)/1000; %Radius of tube [m]
    varphi = 0*pi/2; %Angle of the tube with respect to the horizontal [rad]
    %Calculated parameters
    alpha_0 = acos((R_t-R_r)/L); %Rest angle of the bristle inside the tube [rad]
    A = alpha_0 - alpha_r;
    %Speed calculation
    Hz = RPM/60; %Speed of motor [cyc/s]
    T = 1/Hz; %Speed of a cycle [s/cyc]
    w = 2*pi*Hz; %Speed of motor [rad/s]
end